import React from 'react';
import './App.css';
import NavBar from './NavBar.js';

function App() {
  return (
    <main className="App">
            <NavBar style="background-color:powderblue;"/>
        <h1 style="font-family:verdana;">This is a heading</h1>
    </main>
  );
}



export default App;
